import ReactLoading from 'react-loading';


const loader = {
    height: '40px',
    width: '40px',
    fill: '#017BFF',
    position: 'relative',
    top: '252px',
    right: '633px',
}

const Loading = ({ type, color }) => (


        <ReactLoading type={'spinningBubbles'} color={'#017BFF'} height={40} width={40} position={'relative'} style={loader}/> 

);

export default Loading;
